import React, { useState } from "react";

const Test = () => {
    const [click_num, setClickNum] = useState(0);

    const onButtonClick = () => {
        click_num++;
    }

    return(
        <div>
            <p>This is Test element. clicked {click_num}</p>
            <button onClick={onButtonClick}>Click Me!!</button>
        </div>
    )
};

export default Test;
